import './ExpenseForm.css';

const ExpenseForm = () => {
  return (
    <div className="new-expense__controls">
      <input id="form-input" className="new-expense__control" type="label">Enter a new Expense</input>
      <label className="new-expense__control" for="form-input" placeholder="Deck Washing"></label>
    </div>
 ) 
}

export default ExpenseForm;
